import React from "react";
import {Button} from 'antd';
import Geocode from "react-geocode";

const Employee = ({coordinate, id, removeItem}) => {

    const removeEmployee = () => {
        removeItem(id)
    }

    const options = {
        era: 'long',
        year: 'numeric',
        month: 'long',
        day: 'numeric',
        weekday: 'long',
        timezone: 'UTC',
        hour: 'numeric',
        minute: 'numeric',
        second: 'numeric'
    };

    Geocode.fromLatLng("48.8583701", "2.2922926").then(
        response => {
            const address = response.results[0].formatted_address;
            console.log(address);
        },
        error => {
            console.error(error);
        }
    );

    return <div>
        <div>
            <span>
                            <div>Latitude: {coordinate.latitude}</div>
                            <div>Longitude: {coordinate.longitude}</div>
                            <div>Date: {coordinate.date.toLocaleString("en", options)}</div>


                        </span>

        </div>

        <Button danger onClick={removeEmployee}>Delete</Button>

    </div>
}

export default Employee;
